// React component: Player Roster & Payments (Tab 5)
import React from 'react';

const PlayerRosterPaymentsPage = () => {
  const roster = [
    { name: 'PackAttack23', status: '‚úÖ Paid in Full' },
    { name: 'BlitzQueen', status: '‚ö†Ô∏è Partial Payment' },
    { name: 'Masterblaster', status: '‚úÖ Paid in Full' },
    { name: 'FieldGeneral', status: '‚ùå Not Paid' },
  ];

  return (
    <div className="p-4 border rounded shadow bg-white">
      <h2 className="text-xl font-bold mb-4">üßæ Player Roster & Payments</h2>

      <table className="w-full table-auto border">
        <thead>
          <tr>
            <th className="border px-4 py-2 text-left">Player Game Name</th>
            <th className="border px-4 py-2 text-left">Payment Status</th>
          </tr>
        </thead>
        <tbody>
          {roster.map((player, index) => (
            <tr key={index}>
              <td className="border px-4 py-2">{player.name}</td>
              <td className="border px-4 py-2">{player.status}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <p className="text-sm text-gray-600 mt-4">üìù (Payment updates can be managed from the Administration Tools tab)</p>
    </div>
  );
};

export default PlayerRosterPaymentsPage;
